/*
Grab references to canvas element to run DOSBox inside.
Insert this element into the global scope to replace code which searches for it by ID, which seems not to work.
*/
var container = document.getElementsByTagName("div")[0];
var canvas = container.getElementsByTagName("canvas")[0];
document.globalCanvas = canvas;
document.title = "doom.svg";

console.log("Loading DOSBox...");

